import styled from "styled-components";

export const GraphicTag = styled.div`
  background: cyan;
  height: 25%;
  width: 100%;
`;

export const GraphicTexts = styled.div`
  background: gray;
  width: 100%;
  height: 50%;
`;

export const TitleTag = styled.text`
  font-size: 15px;
  color: black;
  span{
    font-weight: bold;
  }
`;
